import React from 'react'
import modules from "./Cart.module.css";
import Modal from '../UI/Modal';

const Cart = (props) => {
    const cartItems = <ul className={modules["cart-items"]}>{[{id: "c1", name:"sushi", amount:3, price: 20}].
    map((item)=> { <cartItems name={item.name}/>} )}</ul>

  return (
    <Modal >
        {cartItems}
        <div className={modules.total}>
         <span>Total amount</span>   
         <span>60</span>  
         </div>
        <div> 
        <button className={modules["button--alt"]}>close</button>
        <button className={modules.button}>order</button>

        </div>
    </Modal>
  )
}

export default Cart
